window.bookSummaryJSON = "<p><b>As survivors come together in the wake of a zombie apocalypse, a deadly new menace emerges, in this dystopian horror series.</b></p> <p>After nearly four years, the zombie epidemic has almost burned itself out. Once a lone survivor on the brink of insanity, Gus Berry has a new life on a communal farm, his daily routine of policing the fields only rarely disrupted by straying undead. Gus’s drinking binges are over, and the dark days of Annapolis are soon to be a distant memory. But his troubles are far from over . . .</p> <p>When Gus is asked to search for a group of missing scavengers, he reluctantly agrees. But he soon discovers a new predator has been unleashed upon the land, one determined to harvest every last mortal life—and feed it to a ravenous machine.</p>"; 
